// create a map in the "map" div, set the view to a given place and zoom
var map = L.map('map').setView(INITIAL_COORDINATES, INITIAL_ZOOM);

// add an OpenStreetMap tile layer
L.tileLayer(MAPBOX_TILE_LAYER_URL, {
    attribution: '&copy; Mapa base: <a href="http://osm.org/copyright">OpenStreetMap</a>'
}).addTo(map);

// defining styles
var lineStyleConstructedBRT           = {"color": "#ff7800","weight": 5,"opacity": 1},
    lineStyleUnderConstructionBRT     = {"color": "#666666","weight": 5,"opacity": 1},
    lineStylePlannedBRT               = {"color": "#CCCCCC","weight": 5,"opacity": 1},
    lineStyleOutrosModosEstruturantes = {"color": "#000000","weight": 3,"opacity": 1};

// defining popups
var onEachFeature = function(feature, layer){
  // does this feature have a property named "Name"?
  if(feature.properties && feature.properties.Name){
    var popupText = feature.properties.Name;

    if(feature.properties.Status){
      var statusText;
      switch(feature.properties.Status){
        case 'Open':
          statusText = 'Em funcionamento';
          break;
        case 'U.C.':
          statusText = 'Em construo';
          break;
        case 'Planned':
          statusText = 'Planejado';
          break;
      }
      popupText += '<br>' + statusText;
    }

    layer.bindPopup(popupText);
  }
};

// defining geojson's objects
var geoJsonTransOeste          = L.geoJson(LINE_TRANSOESTE_CONSTRUIDA_GEOJSON_DATA, {onEachFeature: onEachFeature, style: lineStyleConstructedBRT}),
    geoJsonTransOesteLote0     = L.geoJson(LINE_TRANSOESTE_LOTE_0_GEOJSON_DATA,     {onEachFeature: onEachFeature, style: lineStyleUnderConstructionBRT}),
    geoJsonTransOestePlanejada = L.geoJson(LINE_TRANSOESTE_PLANEJADA_GEOJSON_DATA,  {onEachFeature: onEachFeature, style: lineStylePlannedBRT}),
    geoJsonTransCarioca        = L.geoJson(LINE_TRANSCARIOCA_GEOJSON_DATA,          {onEachFeature: onEachFeature, style: lineStyleConstructedBRT}),
    geoJsonTransOlimpica       = L.geoJson(LINE_TRANSOLIMPICA_GEOJSON_DATA,         {onEachFeature: onEachFeature, style: lineStyleUnderConstructionBRT}),
    geoJsonTO_TC               = L.geoJson(LINE_TO_TC_GEOJSON_DATA,                 {onEachFeature: onEachFeature, style: lineStyleUnderConstructionBRT}),
    geoJsonTransBrasil         = L.geoJson(LINE_TRANSBRASIL_GEOJSON_DATA,           {onEachFeature: onEachFeature, style: lineStyleUnderConstructionBRT}),
    geoJsonMetroRioLinha1      = L.geoJson(LINE_METRORIO_LINHA1,                    {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonMetroRioLinha2      = L.geoJson(LINE_METRORIO_LINHA2,                    {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonSuperViaSantaCruz   = L.geoJson(LINE_SUPERVIA_SCZ,                       {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonSuperViaSaracuruna  = L.geoJson(LINE_SUPERVIA_SRC,                       {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonSuperViaJaperi      = L.geoJson(LINE_SUPERVIA_JPI,                       {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonSuperViaGuapimirim  = L.geoJson(LINE_SUPERVIA_GPI,                       {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonSuperViaBelfordRoxo = L.geoJson(LINE_SUPERVIA_BRX,                       {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes}),
    geoJsonVltCarioca          = L.geoJson(LINE_VLT_CARIOCA,                        {onEachFeature: onEachFeature, style: lineStyleOutrosModosEstruturantes});

// defining layers
var layerTransOeste    = L.layerGroup([geoJsonTransOeste, geoJsonTransOesteLote0, geoJsonTransOestePlanejada]),
    layerTransCarioca  = L.layerGroup([geoJsonTransCarioca]),
    layerTransOlimpica = L.layerGroup([geoJsonTransOlimpica, geoJsonTO_TC]),
    layerTransBrasil   = L.layerGroup([geoJsonTransBrasil]),
    layerOutrosModos   = L.layerGroup([geoJsonMetroRioLinha1, geoJsonMetroRioLinha2, geoJsonSuperViaSantaCruz, geoJsonSuperViaSaracuruna, geoJsonSuperViaJaperi, geoJsonSuperViaJaperi, geoJsonSuperViaBelfordRoxo, geoJsonVltCarioca]);

var overlayMaps = {
  "BRT TransOeste":    layerTransOeste,
  "BRT TransCarioca":  layerTransCarioca,
  "BRT TransOlmpica": layerTransOlimpica,
  "BRT TransBrasil":   layerTransBrasil,
  "Outros Modos Estruturantes": layerOutrosModos
};

// adding layer control to map
L.control.layers(null, overlayMaps).addTo(map);

// initiating pre-opened layers
layerTransOeste.addTo(map);
layerTransCarioca.addTo(map);
layerTransOlimpica.addTo(map);
layerTransBrasil.addTo(map);
layerOutrosModos.addTo(map);